import "./infobar.css";

class Infobar extends Component{
    constructor(prop){
        super(prop);
        this.state = {
            coin: []
        };
    }

    componentDidMount(){

        // const proxyurl = "https://cors-anywhere.herokuapp.com/";
        // let config = {
        //     'Authorization': '776194b8-0b73-4227-9b92-cc67fbed4dcf',
        //     'Access-Control-Allow-Origin': true
        // };

        // axios.get(proxyurl + 'https://pro-api.coinmarketcap.com/v1/cryptocurrency/info', {headers: config})
        //     .then(response => {
        //         console.log(response);
        //         this.setState({
        //             coin: response.data[0]
        //         })
        //     }).catch(() => console.log('Someting going wrong'));
        const requestOptions = {
            method: 'GET',
            uri: 'https://pro-api.coinmarketcap.com/v1/cryptocurrency/info',
            qs: {
              start: 1,
              limit: 10,
              convert: 'USD'
            },
            headers: {
              'X-CMC_PRO_API_KEY': '2df9e5ed-a6f7-45b3-8284-2d4c64b8f802',
              'Access-Control-Allow-Origin': true
            },
            json: true,
            gzip: true
          };

          rp(requestOptions).then(response => {
            console.log('API call response:', response);
          }).catch((err) => {
            console.log('API call error:', err.message);
          });
    }

    render(){

        let storing = this.state.coin.rank;
        return(
            <div>
            {storing}
            <p>Hello</p>
            </div>
        )
    }
}

export default Infobar;
